Endpoint: ENDPOINT_DS_ADD_USERS Operation, where the commit contains one or more inline Add proposals containing clients of one or more new users. The sender has to additionally provide a signature of the user's QS to help the DS validate that the KeyPackages indeed all belong to one user, as well as a timestamp to prove that the KeyPackages were recently obtained. struct AddUsersParams { commit: MlsMessage, group_state_ear_key: GroupStateEarKey, group_info_update: GroupInfoUpdate, welcome: Welcome, welcome_attribution_info: Vec<WelcomeAttributionInfo>, key_package_batches: Vec<KeyPackageBatch>,
} struct AddUsersParamsAad { encrypted_credential_information: Vec<Vec<u8>>
} The commit must include the AddUserParamsAad of all added users in the AAD of the MLSContent, where the ciphertexts in the encrypted_credential_information are sorted in the same way as the Add proposals in the commit. This operation can only be performed by clients of users marked as admin and all KeyPackages have to contain an extension that contains a ClientQueueConfig . Upon reception, the DS hashes the KeyPackages in all Add proposals contained in the commit. The KeyPackageBatches indicate, which KeyPackages belong to which user. If there are KeyPackages for which there is no matching KeyPackageRef in any KeyPackageBatch, or if there is a KeyPackageRef in a batch that has no corresponding Add proposal, the commit is invalid. Otherwise, the DS creates a user proile for each batch with the leaf indices of the KeyPackages referenced within. The user auth key of the new user remains empty until the first update of one of the user's clients. The DS also has to verify that the timestamp is not older than the DS' configured maximal KeyPackageBatch age. Finally, the DS sends the commit to the group members by sending them on to its local QS, either for it to forward the the client's federated QS or to a local queue. It also sends WelcomeBundles to the newly added clients. Authentication DsSenderId: UserKeyHash Future work: Tighten up DS validation using Zero-Knowledge proofs ZKPs could allow the DS to verify that the sender of a Welcome sends the correct encrypted information Alternatively, the recipient of the Welcome could let the DS know that it received a bogus Welcome. The problem here is how the recipient can prove that the Welcome is indeed bogus.

